import Ticket from './components/Ticket';
import CreateTicket from './components/CreateTicket';
import Booked from './components/Booked';
import DelTicket from './components/DelTicket'
import TicketDeleted from './components/TicketDeleted' 
import NavbarLimit from './components/NavbarLimit';
document.body.style.backgroundColor='white'
import { useNavigate } from 'react-router-dom';
i
export default function App() {
  const [name,setName]=React.useState(false)
  const [loginStatus2, setloginStatus2] = useState("");
  const [isActive, setIsActive] = useState(false);
  const navigate = useNavigate();
  const [values, setValues] = useState({
    email: "",
    password: "",
  });
  // const [loginStatus2, setloginStatus2] = useState("");
  const [errors, setErrors] = useState({});

  const [isLogIn, setIsLogIn] = useState(true);
  // const [isActive, setIsActive] = useState(false);


  const [loginStatus, setloginStatus] = useState(false);
  const handleSubmitL = (e) => {
    e.preventDefault();
    const err=validation(values);
    setErrors(err)
    if( err.email==="" && err.password===""){

    fetch("http://localhost:8081/Login", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        email: values.email,
        password: values.password,
      }),
    })
      .then((res) => res.json())
      .then((data) => {
        if (data.message) {
          setloginStatus2(data.message);
          console.log(data.message)
        }else{
          const isAdmin = data.isAdmin;

          // Example: if user is admin, redirect to admin page
          if (isAdmin) {
              // setIsLog("true");
              setName(true)
              console.log("admin")
              navigate('/ShowAndBook');
          } else {
              // If not admin, redirect to regular user page
              // setIsLog("true");
              setName(true)

              navigate('/ShowAndBook');
          }




        }
      })
      .catch((error) => {
        console.error("Error:", error);
        // setSharedInteger(0);
      });
    }
  };



    // const [isButtonDisabled, setButtonDisabled] = useState(false);





  return (
    <>



        <Router>
<ShowNavbar>
{loginStatus==="true"?<Navbar  navbar_item1="Student Information" navbar_item2="Register"  navbar_item3="Edit" navbar_item4="Delete" />
:<NavbarLimit  navbar_item1="Student Information" navbar_item2="Register"/>}

</ShowNavbar>



    <div className="container my-3"  >
    <Routes>
      <Route exact path="/About" element={<About />}/>
      <Route exact path="/" element={<Textform />}/>
      {/* <Textform mode={mode}showAlert={showAlert} heading="Enter your text below to analyze"  /> */}
<Route exact path="/Concert" element={<Concert/>}/>
<Route exact path="/Create" element={<Create/>}/>
<Route exact path="/Edit" element={<Edit/>}/>
<Route exact path="/Delete" element={<Delete/>}/>
<Route exact path="/Edit2" element={<Edit2/>}/>
<Route exact path='/TicketDeleted' element={<TicketDeleted/>}/>
<Route exact path="/Delete_confirm" element={<DeleteConfirm/>}/>
<Route exact path='/ConcertEntry' element={<ConcertEntry/>}/>
{/* <Route exact path="/Login" element={<Login/>}/> */}
<Route path="/Signup" element={<Signup/>}/>
<Route path="/Login" element={<Login/>}/>
<Route path="/Created" element={<Created/>}/>
<Route path='/ShowAndId' element={<ShowAndId/>}/>
<Route path='/ShowAndDelete' element={<ShowAndDelete/>}/>
<Route path='/Delete2' element={<Delete2/>}/>
<Route exact path='/DelTicket' element={<DelTicket/>}/>
<Route path='/Ticket' element={<Ticket/>}/>

<Route path='/CreateTicket' element={<CreateTicket/>}/>

<Route path='/ShowAndBook' element={<ShowAndBook/>}/>

<Route path='/Booked' element={<Booked/>}/>

    </Routes>



   </div>
  </Router>


    </>
  )
}
